                    //             small_header=false&
                    //             adapt_container_width=true&
                    //             hide_cover=false&show_facepile=true&
                    //             appId" 
                    src="http://www.goggle.com"
                    title="widget"
                    width="340" 
                    height="100%" 
                    // X-Frame-Options="SAMEORIGIN"
